import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box, Grid, Container } from '@mui/material';
import { Link } from 'react-router-dom';
import FitnessCenterIcon from '@mui/icons-material/FitnessCenter';

const Home = () => {
  return (
    <>
      {/* Navbar */}
      <AppBar position="static" color="default" elevation={1}>
        <Toolbar>
          <FitnessCenterIcon sx={{ mr: 1, color: 'primary.main' }} />
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Fitness Tracker
          </Typography>
          <Link to="/login" style={{ textDecoration: 'none' }}>
            <Button color="primary" variant="outlined">Login</Button>
          </Link>
        </Toolbar>
      </AppBar>

      {/* Main content */}
      <Container maxWidth="lg" sx={{ paddingY: 8 }}>
        <Grid container spacing={4} alignItems="center">
          {/* Left: Fitness Image */}
          <Grid item xs={12} md={6}>
            <img
              src="https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b?auto=format&fit=crop&w=800&q=60"
              alt="Fitness"
              style={{ width: '100%', borderRadius: 8 }}
            />
          </Grid>

          {/* Right: Text + Buttons */}
          <Grid item xs={12} md={6}>
            <Typography variant="h3" gutterBottom>
              Welcome to Fitness Tracker
            </Typography>
            <Typography variant="h6" paragraph>
              Track your progress, manage exercise plans, and collaborate with your trainer — all in one app. Whether you're just starting out or a seasoned trainer, we’ve got you covered.
            </Typography>

            <Box sx={{ mt: 3 }}>
              <Link to="/trainer/dashboard" style={{ textDecoration: 'none', marginRight: 10 }}>
                <Button variant="contained" color="primary">Go to Dashboard</Button>
              </Link>
              <Link to="/login" style={{ textDecoration: 'none' }}>
                <Button variant="outlined" color="secondary">Login with Google</Button>
              </Link>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default Home;
